    [],nt"revision_timestamp": "2016-07-27T22:41:25.979905",nt"name": "a-report-on-fish-and-wildlife-resources-in-relation-to-the-flood-control-plan-for-the-sny-",nt"isopen":
    false,nt"url": null,nt"notes": "The flood control plan for the Sny Biver
    and tributaries id proposed "by the Department of the Army, Corps of Engineers,
    to alleviate flood damages on Mississippi River "bottom lands within the Sny Basin,
    The plan consists essentially of three phases: (l) improving minor tributary drainage
    into the Sny and diverting locally pounded runoff into the Mississippi River "by
    gravity or pumping; (2} diverting major tributary drainage directly into the Mississippi
    River; (S) constructing a closing levee across the Sny Bottoms to prevent flooding
    from Mississippi River "backwater. About- 24,000 acres of retired agricultural
    land will "be protected from floods. This report is an evaluation of the fish and
    wildlife resources affected "by the project. The Illinois Department of Conservation
    and the Illinois Natural History Survey cooperated in the field investigation. Residents
    in the vicinity of the project also gave valuable assistance to this Service during
    the field investigations.",nt"license_title": "License Not Specified",nt"extras":
